import React from "react";

export default function Home() {
  return (
    <section className="text-center py-20 px-4">
      <h1 className="text-5xl font-bold text-blue-500 mb-4">Bienvenue chez NovaWeb</h1>
      <p className="text-lg text-gray-500 dark:text-gray-300 max-w-xl mx-auto mb-8">
        Nous créons des expériences web modernes, performantes et optimisées pour vos utilisateurs.
      </p>
      <a href="/services" className="inline-block px-6 py-3 bg-blue-500 text-white rounded-xl hover:bg-blue-600 transition">Découvrir nos services</a>
    </section>
  );
}
